import React from 'react';
import styles from './header.module.css';


const Header = (props) => {
        return (
            <section className={styles.header}>
            <div className={styles.header__container}>
                <img src={title} alt="new Restaurant" className={styles.new__avatar}/>
                <h1 className={styles.header__title}> Find Our Restaurant </h1>
                <h2 className={styles.header__description}>입맛대로, 취향대로</h2>
            </div>
        </section>
        );        

};


export default Header;
